import React from "react";

const Dropdown = ({ jobs }) => {
  // jobs.forEach((job) => console.log(job));
  return (
    <select>
      {jobs.map((job) => (
        <div>{job}</div>
      ))}
    </select>
  );
};

export default Dropdown;
